<h2 id="log-types" tabindex="-1"><a class="header-anchor" href="#log-types" aria-hidden="true">#</a> Log types</h2>
<p>Currently, our console logs are of 5 types.</p>
<ol>
<li>log</li>
<li>info</li>
<li>success</li>
<li>warning</li>
<li>danger</li>
<li>transaction</li>
</ol>
<p>Different types will print logs in different colors. the log will be in grey, info in blue, success in green, warning in yellow, and danger will be in red.</p>
<h2 id="dependencies" tabindex="-1"><a class="header-anchor" href="#dependencies" aria-hidden="true">#</a> Dependencies</h2>
<div class="language-yaml line-numbers-mode" data-ext="yml"><pre v-pre class="language-yaml"><code>  <span class="token key atrule">colorize</span><span class="token punctuation">:</span> ^3.0.0
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h2 id="use-cases" tabindex="-1"><a class="header-anchor" href="#use-cases" aria-hidden="true">#</a> Use cases</h2>
<div class="custom-container tip"><p class="custom-container-title">use cases</p>
<ul>
<li>To log transaction time</li>
<li>To see formatted (prettier) objects in the console easily readable by the human eye</li>
<li>To easily differentiate between different kinds of events.</li>
</ul>
</div>
<h2 id="internal-use-in-logging-library-dart-only" tabindex="-1"><a class="header-anchor" href="#internal-use-in-logging-library-dart-only" aria-hidden="true">#</a> Internal use (in <RouterLink to="/vaahflutter/directory_structure/vaahextendflutter/services/logging_library/logging_library.html">logging_library.dart</RouterLink> only)</h2>
<p>Call static methods of the Console class to log the events.</p>
