<span class="token class-name">Console</span><span class="token punctuation">.</span><span class="token function">info</span><span class="token punctuation">(</span><span class="token string-literal"><span class="token string">"Message"</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name">Console</span><span class="token punctuation">.</span><span class="token function">success</span><span class="token punctuation">(</span><span class="token string-literal"><span class="token string">"Message"</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>
